    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

    <script>/* global slideshow */
(function () {
  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    [...document.querySelectorAll('.panel-name')]
      .map(el => el.textContent.trim())

    const panelIds = {}

    const uniquePanelId = (name) => {
      name = encodeURIComponent(name.toLowerCase().replace(/[\s]/g, '-'))
      if (Object.keys(panelIds).includes(name)) {
        name += ++panelIds[name]
      } else {
        panelIds[name] = 1
      }
      return name
    }

    const identifyPanelName = (item) => {
      let name = 'Panel'

      // If the item doesn't have a parent element, then we've already processed
      // it, probably because we're in an Rmd, and it's been removed from the DOM
      if (!item.parentElement) {
        return
      }

      // In R Markdown when header-attrs.js is present, we may have found a
      // section header but the class attributes won't be duplicated on the <hX> tag
      if (
        (item.tagName === 'SECTION' || item.classList.contains('section')) &&
        /^H[1-6]/.test(item.children[0].tagName)
      ) {
        name = item.children[0].textContent
        item.classList.remove('panel-name')
        item.removeChild(item.children[0])
        return name
      }

      const nameDiv = item.querySelector('.panel-name')
      if (!nameDiv) return name

      // In remarkjs the .panel-name span might be in a paragraph tag
      // and if the <p> is empty, we'll remove it
      if (
        nameDiv.tagName === 'SPAN' &&
        nameDiv.parentNode.tagName === 'P' &&
        nameDiv.textContent === nameDiv.parentNode.textContent
      ) {
        name = nameDiv.textContent
        item.removeChild(nameDiv.parentNode)
        return name
      }

      // If none of the above, remove the nameDiv and return the name
      name = nameDiv.textContent
      nameDiv.parentNode.removeChild(nameDiv)
      return name
    }

    const processPanelItem = (item) => {
      const name = identifyPanelName(item)
      if (!name) {
        return null
      }
      return { name, content: item.children, id: uniquePanelId(name) }
    }

    const getCurrentPanelFromUrl = (panelset) => {
      const params = new URLSearchParams(window.location.search)
      return params.get(panelset)
    }

    const reflowPanelSet = (panels, idx) => {
      const res = document.createElement('div')
      res.className = 'panelset'
      res.id = 'panelset' + (idx > 0 ? idx : '')
      const panelSelected = getCurrentPanelFromUrl(res.id)

      // create header row
      const headerRow = document.createElement('ul')
      headerRow.className = 'panel-tabs'
      headerRow.setAttribute('role', 'tablist')
      panels
        .map((p, idx) => {
          const panelHeaderItem = document.createElement('li')
          panelHeaderItem.className = 'panel-tab'
          panelHeaderItem.setAttribute('role', 'tab')
          const thisPanelIsActive = panelSelected ? panelSelected === p.id : idx === 0
          if (thisPanelIsActive) {
            panelHeaderItem.classList.add('panel-tab-active')
            panelHeaderItem.setAttribute('aria-selected', true)
          }
          panelHeaderItem.tabIndex = 0
          panelHeaderItem.id = res.id + '_' + p.id // #panelsetid_panelid

          const panelHeaderLink = document.createElement('a')
          panelHeaderLink.href = '?' + res.id + '=' + p.id + '#' + panelHeaderItem.id
          panelHeaderLink.setAttribute('onclick', 'return false;')
          panelHeaderLink.tabIndex = -1 // list item is tabable, not link
          panelHeaderLink.innerHTML = p.name
          panelHeaderLink.setAttribute('aria-controls', p.id)

          panelHeaderItem.appendChild(panelHeaderLink)
          return panelHeaderItem
        })
        .forEach(el => headerRow.appendChild(el))

      res.appendChild(headerRow)

      panels
        .map((p, idx) => {
          const panelContent = document.createElement('section')
          panelContent.className = 'panel'
          panelContent.setAttribute('role', 'tabpanel')
          const thisPanelIsActive = panelSelected ? panelSelected === p.id : idx === 0
          panelContent.classList.toggle('panel-active', thisPanelIsActive)
          panelContent.id = p.id
          panelContent.setAttribute('aria-labelledby', p.id)
          Array.from(p.content).forEach(el => panelContent.appendChild(el))
          return panelContent
        })
        .forEach(el => res.appendChild(el))

      return res
    }

    /*
     * Update selected panel for panelset or delete panelset from query string
     *
     * @param panelset Panelset ID to update in the search params
     * @param panel Panel ID of selected panel in panelset, or null to delete from search params
     * @param params Current params object, or params from window.location.search
     */
    function updateSearchParams (panelset, panel, params = new URLSearchParams(window.location.search)) {
      if (panel) {
        params.set(panelset, panel)
      } else {
        params.delete(panelset)
      }
      return params
    }

    /*
     * Update the URL to match params
     */
    const updateUrl = (params) => {
      if (typeof params === 'undefined') return
      params = params.toString() ? ('?' + params.toString()) : ''
      const { pathname, hash } = window.location
      const uri = pathname + params + hash
      window.history.replaceState(uri, '', uri)
    }

    const togglePanel = (clicked) => {
      if (clicked.nodeName.toUpperCase() === 'A') {
        clicked = clicked.parentElement
      }
      if (!clicked.classList.contains('panel-tab')) return
      if (clicked.classList.contains('panel-tab-active')) return

      const tabs = clicked.parentNode
        .querySelectorAll('.panel-tab')
      const panels = clicked.parentNode.parentNode
        .querySelectorAll('.panel')
      const panelTabClicked = clicked.children[0].getAttribute('aria-controls')
      const panelClicked = clicked.parentNode.parentNode.id

      Array.from(tabs)
        .forEach(t => {
          t.classList.remove('panel-tab-active')
          t.removeAttribute('aria-selected')
        })
      Array.from(panels)
        .forEach(p => {
          const active = p.id === panelTabClicked
          p.classList.toggle('panel-active', active)
          // make inactive panels inaccessible by keyboard navigation
          if (active) {
            p.removeAttribute('tabIndex')
            p.removeAttribute('aria-hidden')
          } else {
            p.setAttribute('tabIndex', -1)
            p.setAttribute('aria-hidden', true)
          }
        })

      clicked.classList.add('panel-tab-active')
      clicked.setAttribute('aria-selected', true)

      // emit window resize event to trick html widgets into fitting to the panel width
      window.dispatchEvent(new Event('resize'))

      // update query string
      const params = updateSearchParams(panelClicked, panelTabClicked)
      updateUrl(params)
    }

    const initPanelSet = (panelset, idx) => {
      let panels = Array.from(panelset.querySelectorAll('.panel'))
      if (!panels.length && panelset.matches('.section[class*="level"]')) {
        // we're in tabset-alike R Markdown
        const panelsetLevel = [...panelset.classList]
          .filter(s => s.match(/^level/))[0]
          .replace('level', '')

        // move children that aren't inside a section up above the panelset
        Array.from(panelset.children).forEach(function (el) {
          if (el.matches('div.section[class*="level"]')) return
          panelset.parentElement.insertBefore(el, panelset)
        })

        // panels are all .sections with .level<panelsetLevel + 1>
        const panelLevel = +panelsetLevel + 1
        panels = Array.from(panelset.querySelectorAll(`.section.level${panelLevel}`))
      }

      if (!panels.length) return

      const contents = panels.map(processPanelItem).filter(o => o !== null)
      const newPanelSet = reflowPanelSet(contents, idx)
      newPanelSet.classList = panelset.classList
      panelset.parentNode.insertBefore(newPanelSet, panelset)
      panelset.parentNode.removeChild(panelset)

      // click and touch events
      const panelTabs = newPanelSet.querySelector('.panel-tabs');
      ['click', 'touchend'].forEach(eventType => {
        panelTabs.addEventListener(eventType, function (ev) {
          togglePanel(ev.target)
          ev.stopPropagation()
        })
      })
      panelTabs.addEventListener('touchmove', function (ev) {
        ev.preventDefault()
      })

      // key events
      newPanelSet
        .querySelector('.panel-tabs')
        .addEventListener('keydown', (ev) => {
          const self = ev.currentTarget.querySelector('.panel-tab-active')
          if (ev.code === 'Space' || ev.code === 'Enter') {
            togglePanel(ev.target)
            ev.stopPropagation()
          } else if (ev.code === 'ArrowLeft' && self.previousSibling) {
            togglePanel(self.previousSibling)
            self.previousSibling.focus()
            ev.stopPropagation()
          } else if (ev.code === 'ArrowRight' && self.nextSibling) {
            togglePanel(self.nextSibling)
            self.nextSibling.focus()
            ev.stopPropagation()
          }
        })

      return panels
    }

    // initialize panels
    Array.from(document.querySelectorAll('.panelset')).map(initPanelSet)

    if (typeof slideshow !== 'undefined') {
      const getVisibleActivePanelInfo = () => {
        const slidePanels = document.querySelectorAll('.remark-visible .panel-tab-active')

        if (!slidePanels.length) return null

        return slidePanels.map(panel => {
          return {
            panel,
            panelId: panel.children[0].getAttribute('aria-controls'),
            panelSetId: panel.parentNode.parentNode.id
          }
        })
      }

      slideshow.on('hideSlide', slide => {
        // clear focus if we had a panel-tab selected
        document.activeElement.blur()

        // clear search query for panelsets in current slide
        const params = [...document.querySelectorAll('.remark-visible .panelset')]
          .reduce(function (params, panelset) {
            return updateSearchParams(panelset.id, null, params)
          }, new URLSearchParams(window.location.search))

        updateUrl(params)
      })

      slideshow.on('afterShowSlide', slide => {
        const slidePanels = getVisibleActivePanelInfo()

        if (slidePanels) {
          // only first panel gets focus
          slidePanels[0].panel.focus()
          // but still update the url to reflect all active panels
          const params = slidePanels.reduce(
            function (params, { panelId, panelSetId }) {
              return updateSearchParams(panelSetId, panelId, params)
            },
            new URLSearchParams(window.location.search)
          )
          updateUrl(params)
        }
      })
    }
  })
})()
</script>
    <script>$(document).ready(function(){

        $('[data-toggle="popover"]').popover();

});

# Chapter 8: Gross Domestic Product
## Measuring Total Production and Income

&lt;img src=&quot;data:image/png;base64,#images/qr_codes/QR6.png&quot; width=&quot;40%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---

## GDP Measures Total Production

.panelset[
.panel[.panel-name[Intro]
When we want to study the overall economy and its participants, the models and tools of macroeconomics become very useful.
- **Business cycle**: Alternating periods of economic expansion and economic recession.
- **Expansion**: The period of a business cycle during which the total production and total employment are increasing.
- **Recession**: The period of a business cycle during which total production and total employment are decreasing.
- **Economic growth**: The ability of an economy to produce increasing quantities of goods and services.
- **Inflation rate**: The percentage increase in the price level from one year to the next.

Over the coming chapters, we will explore many aspects of the economy, including how all the elements above relate to one another.
- For this chapter, we have a less lofty goal: to figure out how to measure the total output of an economy.
- Being able to measure total output is incredibly important, since much of macroeconomics depends on our ability to measure and predict aggregate economic activity.

]
.panel[.panel-name[GDP]
Gross Domestic Product (GDP)
- most common measure used by economists of overall economic activity in an economy
- the *market value* of all *final goods and services* produced in a country during a period of time, typically one year.

**Market value**
- need a way to add up number of cars, melons, haircuts, and all other goods and services
- we value each good and service in monetary terms (e.g. price sold)

**Final good/service**
- a good or service purchased by a final user to calculate GDP
- Why? 
  - **Intermediate goods/services** are inputs into another good or service (e.g. tire on truck) 
  - Counting only final transaction prevents double counting (e.g. cream and ice cream)

]
.panel[.panel-name[GDP Continued]
Gross Domestic Product (GDP)
- most common measure used by economists of overall economic activity in an economy
- the market value of all final goods and services *produced in a country* during a *period of time*, typically one year.

**Produced in a country**
- output produced within a countrys borders
- the ownership of production is irrelevant (domestic/foreign) as long as production takes place in the U.S.
- production overseas does *not* count

**Period of time**
- measure total output only in a given year (only current production)
- this avoids double counting: 
  - if you buy a DVD in 2021, that DVD counts in 2021s GDP
  - if you resell it in 2022, it will not count again in 2022
- GDP counts only new goods and services--not used items

]
.panel[.panel-name[GDP Calculation]


.pull-left[
- Determine which goods and services should be included in the calculation

- Calculate the value of the goods/services to be included (Price * Quantity)

- Sum the values of the final goods/services ($10,255)

## Circular Flow of GDP

.panelset[
.panel[.panel-name[Production and Income]
Two main conceptual ways to measure the total economic activity in an economy: 
1. total production or 
2. total income

When we measure one, we are also measuring the other. Why?
- everything that is produced and sold constitutes income for someone
- so, we have the choice of measuring the value of products produced and sold or the value of incomes

**Each** is a valid way of measuring economic activity.

]
.panel[.panel-name[Circular Flow]
.pull-left[
Simple model of the economy
- amount households spend on goods/services
- measure income of households
]
.pull-right[
&lt;img src=&quot;data:image/png;base64,#images/fig_8_1a.png&quot; width=&quot;45%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]
]
.panel[.panel-name[Government]
.pull-left[
But what about the government?
- receives taxes
- uses those taxes to buy goods and services, and to make transfer payments

**Transfer payments**: payments by the government to households for which the government does not receive a new good or service in return
]
.pull-right[
&lt;img src=&quot;data:image/png;base64,#images/fig_8_1b.png&quot; width=&quot;45%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]
]
.panel[.panel-name[Imports/Exports]
.pull-left[
**Imports**: households buy goods and services from firms in other countries

**Exports**: firms sell goods and services to households in other countries
]
.pull-right[
&lt;img src=&quot;data:image/png;base64,#images/fig_8_1c.png&quot; width=&quot;60%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]
]
.panel[.panel-name[Financial]
.pull-left[
**Financial system**: firms that deal specifically in flows of money
- Households elect not to spend some of their income and instead *save* it with financial system firms like banks
- These financial system firms *lend* money to other firms and the government

]
.pull-right[
&lt;img src=&quot;data:image/png;base64,#images/fig_8_1d.png&quot; width=&quot;80%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]
]


]

## Components of GDP

.panelset[
.panel[.panel-name[Overview]
To measure GDP, the Bureau of Economic Analysis (BEA) in the Department of Commerce measures four major categories of expenditures:
- Personal consumption expenditures, or **consumption (C)**
- Gross private domestic investment, or **investment (I)**
- Government consumption and gross investment, or **government purchases (G)**
- Net exports of goods and services, or **net exports (NX)**

**GDP (Y)** can be expressed as the sum of these: 

`$$Y = C + I + G + NX$$`


]
.panel[.panel-name[Consumption]
`$$Y = C + I + G + NX$$`
**Consumption** 
- spending by households on goods and services
- does *not* include spending on new houses (investments)

BEA divides consumption by expenditures:
- **Services**: medical care, education, and haircuts
- **Nondurable goods**: food and clothing, and
- **Durable goods**: automobiles and furniture.
]
.panel[.panel-name[Investment]
`$$Y = C + I + G + NX$$`
.pull-left[
**Investment**
- spending by firms on 
  - new factories, 
  - office buildings, 
  - machinery, and 
  - additions to inventories, 
  - plus spending by households and firms on new houses
]
.pull-right[
**BEA categories of investment**:
- **Business fixed investment**
  - new factories
  - office buildings
  - machinery
  - research and development.
- **Residential investment**, i.e. new single-family and multi-unit houses
- **Changes in business inventories**, i.e. goods that have been produced but not yet sold
]

*Note: in economics, &quot;Investment&quot; does not mean buying stocks and bonds etc., like it does in finance.*
]
.panel[.panel-name[Government Purchases]
`$$Y = C + I + G + NX$$`
**Government purchases** 
- spending by federal, state, and local governments on goods and services
- includes 
  - **government consumption** (like teachers salaries and office supplies) 
  - **government investment** (like highways and military bases)
- excludes
  - transfer payments
  - these do *not* result in immediate production of new goods and services

]
.panel[.panel-name[Net Exports]
`$$Y = C + I + G + NX$$`
**Net Exports**
- NX = exports - imports
- can be *positive* or *negative* (recently negative in US)

To count domestic production (US)
- add up the value of the goods and services sold to foreigners 
- subtract the value of the goods and services sold to Americans by foreigners

An export is not counted otherwise (in C, I, or G), so we need to count it somehow as production.

An import is counted (in C, usually) but we are trying to measure domestic production, so we dont want to count it. Subtracting it achieves this goal.

]
.panel[.panel-name[Components]
&lt;img src=&quot;data:image/png;base64,#images/fig_8_2.png&quot; width=&quot;90%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]

.panel[.panel-name[Value Added]
.pull-left[
An alternative method to measure GDP is to measure the **value added**: 
  - The market value a firm adds to a product.

*The final selling price of a product must equal the sum of the values added to the product at each stage of production.*

The table illustrates this method for a shirt sold on L.L.Beans web site.

]
.pull-right[
&lt;img src=&quot;data:image/png;base64,#images/tab_8_1.png&quot; width=&quot;100%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]

]
]

## Issues with GDP

.panelset[

.panel[.panel-name[Intro]
GDP can be a useful tool to measure total output in an economy. 

Many people go further than this, interpreting GDP as a measure of the well-being of citizens.

However, GDP has shortcomings as both a
- Measure of total production and a
- Measure of well-being
]
.panel[.panel-name[Shortcomings 1]

Omitted from GDP: *household production* and *underground economy*

**Household production**
- such as childcare, cleaning, and cooking is not typically paid for with money
- but these are real contributions are real
- if they were performed by a non-household member and paid for, they would count in GDP

**Underground economy**: 
- transactions concealed from the government to avoid taxes or regulations, or *illegal*
- estimated at 10% or more of the US economy 
- **informal sector** (developing countries)
  - often very large (&gt;50% of total output)
  - development economists say this often reflects poor government policies: 
    + high taxes and regulations
    + low confidence in the security of private property from government seizure

]
.panel[.panel-name[Importance]
How important
If we are comparing GDP from year to year, the size of household production and the underground economy is probably about the same from year to year, so **GDP growth** is a reasonable measure of the *growth in total production*.

However over long periods of time, these shortcomings might be more serious.
- As women have entered the workforce in larger numbers, some household production has been replaced by paid childcare and restaurant meals. 
- So, increases in GDP may exaggerate the increase in actual total production.
]
.panel[.panel-name[Shortcomings 2]
**GDP per capita** (i.e. `\(\frac{GDP}{population}\)`) is often used to represent differences in standards of living from country to country. 

However, even if it accurately measured total production, it would not reflect:
- The value of leisure
- Pollution and other negative effects of production
- Crime and other social problems
- The distribution of income

In fact, improvements in many of these will result in *lower* GDP per capita.
- Lower crime would allow lower spending on police, prisons, and private security. 
- This would decrease GDP but would result in improvements in economic well-being.

]

]

## Real vs. Nominal GDP
.panelset.sideways[
.panel[.panel-name[Intro]
**Nominal GDP** 
- value of final goods and services evaluated at current-year prices
- problem: a dollar today is not the same as a dollar 10 years ago
- solution: translate prices into the same year

**Real GDP** 
- value of final goods and services evaluated at base-year prices
- base-year is arbitrary (currently use 2012)
- problem: 
  - choice of base-year can bias the GDP growth rate
  - relative prices can change from year to year (i.e. really fast growth rates)
- solution: 
  - chain-weighted prices
  - use previous-year prices to adjust current-year production

]
.panel[.panel-name[Calc Real]

&lt;table&gt;
 &lt;thead&gt;
  &lt;tr&gt;
   &lt;th style=&quot;text-align:left;&quot;&gt; Product &lt;/th&gt;
   &lt;th style=&quot;text-align:left;&quot;&gt; Quantity_2012 &lt;/th&gt;
   &lt;th style=&quot;text-align:left;&quot;&gt; Price_2012 &lt;/th&gt;
   &lt;th style=&quot;text-align:left;&quot;&gt; Quantity_2022 &lt;/th&gt;
   &lt;th style=&quot;text-align:left;&quot;&gt; Price_2022 &lt;/th&gt;
  &lt;/tr&gt;
 &lt;/thead&gt;
&lt;tbody&gt;
  &lt;tr&gt;
   &lt;td style=&quot;text-align:left;&quot;&gt; Eye examinations &lt;/td&gt;
   &lt;td style=&quot;text-align:left;&quot;&gt; 80 &lt;/td&gt;
   &lt;td style=&quot;text-align:left;&quot;&gt; $40 &lt;/td&gt;
   &lt;td style=&quot;text-align:left;&quot;&gt; 100 &lt;/td&gt;
   &lt;td style=&quot;text-align:left;&quot;&gt; $50 &lt;/td&gt;
  &lt;/tr&gt;
  &lt;tr&gt;
   &lt;td style=&quot;text-align:left;&quot;&gt; Pizzas &lt;/td&gt;
   &lt;td style=&quot;text-align:left;&quot;&gt; 90 &lt;/td&gt;
   &lt;td style=&quot;text-align:left;&quot;&gt; $11 &lt;/td&gt;
   &lt;td style=&quot;text-align:left;&quot;&gt; 80 &lt;/td&gt;
   &lt;td style=&quot;text-align:left;&quot;&gt; $10 &lt;/td&gt;
  &lt;/tr&gt;
  &lt;tr&gt;
   &lt;td style=&quot;text-align:left;&quot;&gt; Shoes &lt;/td&gt;
   &lt;td style=&quot;text-align:left;&quot;&gt; 15 &lt;/td&gt;
   &lt;td style=&quot;text-align:left;&quot;&gt; $90 &lt;/td&gt;
   &lt;td style=&quot;text-align:left;&quot;&gt; 20 &lt;/td&gt;
   &lt;td style=&quot;text-align:left;&quot;&gt; $100 &lt;/td&gt;
  &lt;/tr&gt;
&lt;/tbody&gt;
&lt;/table&gt;

Calculate total value of output in 2012:

$$
`\begin{aligned}
\text{Total value} &amp;= 80*40+90*11+15*90 \\
&amp;= 3,200 + 990 + 1,350 \\
&amp;= \$5,540
\end{aligned}`
$$

Calculate nominal GDP:

$$
`\begin{aligned}
\text{Nominal GDP} &amp;= 100*50+80*10+20*100 \\
&amp;= \$7,800
\end{aligned}`
$$

Calculate real GDP in 2022 (use prices from 2012)
  
$$
`\begin{aligned}
\text{Real GDP} &amp;= 100*40+80*11+20*90 \\
&amp;= \$6,680
\end{aligned}`
$$

]
.panel[.panel-name[Chart]

&lt;img src=&quot;data:image/png;base64,#images/fig_8_3.png&quot; width=&quot;75%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

]
.panel[.panel-name[GDP Deflator]
Stability vs. volatility: planning for the future
- prefer stable prices
- interested in **price level**: a measure of the average prices of goods and services in the economy
  
How to measure?
- **GDP deflator**: calculated by dividing nominal GDP by real GDP and multiplying by 100
$$
\textit{GDP deflator} = \frac{\textit{Nominal GDP} }{\textit{Real GDP}} \times 100
$$
- Note: base year will be 100 in the base year!
- Why?
]
.panel[.panel-name[Example]
&lt;img src=&quot;data:image/png;base64,#images/tab_8_2.png&quot; width=&quot;80%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

GDP deflator increased from 112.3 to 113.6:
$$
\frac{113.6-112.3}{112.3}*100 = 1.2\%
$$

So, price level rows by 1.2% over this period
]
]

## Other Measures of Total Production and  Income

.panelset[
.panel[.panel-name[Other Measures]
Each quarter, the BEA publishes the **National Income and Product Accounts** tables. These include GDP computations but also:

**Gross national product (GNP)**: Production performed by citizens of a nation, including overseas production.

**National income**: GDP minus the **consumption of fixed capital**; i.e. GDP minus depreciation.

**Personal income**: Income received by households; includes transfer payments but excludes firms retained earnings.

**Disposable personal income**: Personal income minus personal tax payments; this measures the amount that households are able to spend or save.
